import {
  Form,
  FormGroup,
  Input,
  Label,
  Button,
  Container,
  Row,
  Col,
} from "reactstrap";
import { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import { useForm } from "react-hook-form";
import { yupResolver } from "@hookform/resolvers/yup";
import { updateUserProfile, fetchUser } from "../Features/UserSlice";
import { userSchemaValidation } from "../Validations/UserValidations";
import Home from "./Home";

const Profile = () => {
  const user = useSelector((state) => state.users.user);
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const [profilePic, setProfilePic] = useState(null);

  const {
    register,
    handleSubmit,
    reset,
    formState: { errors },
  } = useForm({
    resolver: yupResolver(userSchemaValidation),
    defaultValues: {
      name: "",
      password: "",
      confirmPassword: "",
    },
  });

  useEffect(() => {
    if (user?.email) {
      reset({
        name: user.name || "",
        password: "",
        confirmPassword: "",
      });
    } else {
      navigate("/login");
    }
  }, [user, reset, navigate]);

  const handleUpdate = async (data) => {
    if (data.password !== data.confirmPassword) {
      alert("Passwords do not match!");
      return;
    }

    const updatedUser = new FormData();
    updatedUser.append("email", user.email);
    updatedUser.append("name", data.name);
    updatedUser.append("password", data.password);
    if (profilePic) {
      updatedUser.append("profilePic", profilePic);
    }

    try {
      await dispatch(updateUserProfile(updatedUser)).unwrap();
      await dispatch(fetchUser(user.email)).unwrap(); // ⬅️ Refresh latest user
      alert("Profile Updated Successfully!");
    } catch (error) {
      console.error("Update failed:", error);
      alert("Failed to update profile. Try again.");
    }
  };

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    if (file) {
      setProfilePic(file);
    }
  };

  return (
    <Container fluid>
      <Row>
        <Col md={3}>
          <Home />
        </Col>
        <Col md={6}>
          <Form onSubmit={handleSubmit(handleUpdate)}>
            <div className="mb-3">Upload Photo</div>
            <input type="file" name="profilePic" onChange={handleFileChange} />

            <FormGroup>
              <Label for="name">Name</Label>
              <Input
                id="name"
                name="name"
                type="text"
                {...register("name")}
              />
              {errors.name && (
                <p className="text-danger">{errors.name.message}</p>
              )}
            </FormGroup>

            <FormGroup>
              <Label for="password">Password</Label>
              <Input
                id="password"
                name="password"
                type="password"
                {...register("password")}
              />
              {errors.password && (
                <p className="text-danger">{errors.password.message}</p>
              )}
            </FormGroup>

            <FormGroup>
              <Label for="confirmPassword">Confirm Password</Label>
              <Input
                id="confirmPassword"
                name="confirmPassword"
                type="password"
                {...register("confirmPassword")}
              />
              {errors.confirmPassword && (
                <p className="text-danger">{errors.confirmPassword.message}</p>
              )}
            </FormGroup>

            <FormGroup>
              <Button color="primary" type="submit" block>
                Update Profile
              </Button>
            </FormGroup>
          </Form>
        </Col>
      </Row>
    </Container>
  );
};

export default Profile;
